import { Schema } from "mongoose";
import {Material} from './matirial.model';
import multer from 'multer'

export const createNewDocument = async(req,res) =>{
    try {
        const { subName, dept, semester} = req.body;
        const data = req.body.myFile;
        console.log(data)
        fs.readFile(req.body.myFile, function (err, data) {

            Material.file.data = data;
            // get extension
            Material.file.contentType = req.body.myFile.split('.').pop();
            Material.subName = subName;
            Material.dept = dept;
            Material.semester = semester;
            Material.save(function (err, material){
                if(err){
                    res.status(422).send({message:"Document Does't save", success:false});
                }
                else{
                    res.status(200).send({message:'Document save successfully', success:true});
                }
            })


          });
        //console.log(req.body);
        const material = await Material.create(req.body);
        res.status(200).send({ message: "Document Created successfully.", success:true });
      } catch (error) {
        //console.log(error);
        res.status(422).send({ success: false, message: error });
      }
}
